import { Badge, BlockItem, ItemSubtitle, ItemTitle, ItemWrap } from './style';

export default function Job(props) {
  return (
    <ItemWrap>
      <BlockItem>
        <ItemTitle>Software Engineering Intern</ItemTitle>
        <ItemSubtitle>
          Developed a full-stack application using Angular, Node, and TypeScript.
          Designed custom API routes and classes.
          Wrote stored MS SQL procedures to interact with the API.
        </ItemSubtitle>
      </BlockItem>
    </ItemWrap>
  )
}
